import { ThreeDots } from 'react-loader-spinner';
import classes from './Loading.modual.css';

const Loading = props => {
    <div className={classes.loading}>
        <ThreeDots 
            height="80" 
            width="80" 
            radius="9"
            color="#862706" 
            ariaLabel="three-dots-loading"
            visible={true}
        />
    </div>
}

export default Loading;
